import React from "react";

const ParamCompo = ({ match }) => {
  return (
    <div className="ParamCompo">
      <h4>ParamCompo</h4>
      <p>
        이름 : {null}
        <br />
        나이 : {null} <br />
        주소 : {null}
        <br />
      </p>
    </div>
  );
};

export default ParamCompo;
